import React, { Component } from 'react';

class Index extends Component {
    render() {
        return(
            <div id='customers'>
                <p className='firstname'>First Name</p>
                <p className='lastname'>Last Name</p>
                <p className='homecity'>Home City</p>
                <p className='firstname'> {this.props.customers.first_name}</p>

                <p className='lastname'> {this.props.customers.last_name}</p>

                <p className='homecity'> {this.props.customers.home_city}</p>
            </div>

        )
    }   
}

export default Index;
